package com.project.sigma.model;

import lombok.Data;

import java.time.LocalDate;

@AllArgsConstructor
public class ClienteFisica {
    @Column(name = "id_pessoa")
    private Long idPessoa;

    @OneToOne
    @MapsId
    @JoinColumn(name = "id_pessoa")
    private Long id_pessoa;

package com.project.sigma.model;

import lombok.AllArgsConstructor;
import lombok.Data;
import lombok.NoArgsConstructor;

import java.time.LocalDate;

@Data
@NoArgsConstructor
@AllArgsConstructor
public class ClienteFisico {
    private Long id_pessoa;
    private String cpf;
    private LocalDate data_nascimento;
    
    // Not stored in DB, populated when needed
    private Cliente cliente;
    
    public ClienteFisico(Long id_pessoa, String cpf, LocalDate data_nascimento) {
        this.id_pessoa = id_pessoa;
        this.cpf = cpf;
        this.data_nascimento = data_nascimento;
    }
}

package com.project.sigma.repository;

import com.project.sigma.model.ClienteFisica;
import org.springframework.data.jpa.repository.JpaRepository;
import org.springframework.stereotype.Repository;

import java.util.Optional;

@Repository
public interface ClienteFisicaRepository extends JpaRepository<ClienteFisica, Long> {

    Optional<ClienteFisica> findByCpf(String cpf);
}
